import React from 'react'
import Card from './Card'
import sdata from './Sdata'

const Amazon = () => {
  return (
    <Card
      key={sdata[0].id}
      imgsrc={sdata[0].imgsrc}
      title={sdata[0].title}
      sname={sdata[0].sname}
      link={sdata[0].link}
    />
  )
}

export default Amazon
